import React, { useState, useEffect } from "react";
import Styles from "./AnimatedQuote.module.css";
import Typical from "react-typical";
export default function AnimatedQuote(props) {
	const quoteText = "I love you, not only for what you are, but for what...";
	const arr = quoteText.split(" ");
	const newArr = [];
	for (let i = 0; i <= arr.length - 1; i++) {
		newArr.push(arr.shift());
		/* newArr.push(arr.push(1000)); */
	}

	console.log(newArr);
	return (
		<div className={Styles.quote2}>
			<Typical steps={arr} loop={1} wrapper="p" />
		</div>
	);
}
